import DVnavbar from './components/DVnavbar';
import Board from './components/Board';
import MapOverlay from './components/MapOverlay';

function App() {
  return (
    <>
      <DVnavbar />
      <Board>
        <MapOverlay />
      </Board>
    </>
  );
}

export default App;
